    if(role === 'Мирная жительница') return randomInteger() % 2 === 0 ? <Woman1Icon /> : <Woman2Icon />;
    if(role === 'Мирный житель') return randomInteger() % 2 === 0 ? <Man2Icon /> : <Man2Icon />;
